Insert into BTH_SESSIONS (ID,TITLE,TARGET_AUDIENCE,EXPERIENCE_LEVEL,GRANULARITY,DURATION,SUBMISSION_IDENTIFIER,STATUS,DEMOS,NOTES,COSPEAKERS,TRACK_TAG_ID) values ('95','Deep Dive into Oracle ADF Transactions: Advanced Techniques','ADF Developers, System Architects, Analysts','Intermediate/Working Knowledge','Detailed, in depth (including lines of code)','1','7','Accepted','This session is going to be a deep dive into transaction management in Oracle ADF. I am going to focus on both business service layer and controller layer. The session covers the following topics: - How the framework treats DB transaction and how it correlates with DB connection - How ADF business components (application modules, entities, view objects) interact with transactions  - Understanding Shared transactions - Understanding ADF Controller transaction management - Tips on when to use and when to avoid controller transactions - Advanced techniques of manipulating transactions at the controller layer - Understanding Data Control Frame and Data Control Scope - ADF taskflow transaction options and their impact on AM instances and DB connections The session comes with live hands-on demos illustrating all these aspects in details.',null,null,'369');
