Insert into BTH_SESSIONS (ID,TITLE,TARGET_AUDIENCE,EXPERIENCE_LEVEL,GRANULARITY,DURATION,SUBMISSION_IDENTIFIER,STATUS,DEMOS,NOTES,COSPEAKERS,TRACK_TAG_ID) values ('81','Beyond the Oracle Forms Horizon:  from Forms to ADF in minutes','People interested in software enginering and conversion of legacy applications','Novice/Exploratory','Pretty concrete, real world example or running software','1',null,'Accepted','Well be doing a live demo of a conversion of an application',null,'Rokesh Janki (Qualogy)  Bio:  Rokesh is the founder and Chief Technical Officer of QAFE. Rokesh obtained his MA degree in Computer Science at Leiden University, The Netherlands in 1998. His field of specialization was Algorithms and NP-complete problems. As scheduling problems can be NP-complete, this is the area he decided to tackle. After completing his study, Rokesh worked for the University of Leiden, ORTEC consultants, and Ponte Vecchio before joining Qualogy. It is at Qualogy he used his experiences to establish QAFE, a suite of products to do Oracle Forms Conversion to modern web architectures. Rokesh designed QAFE, inspired by Google, Apple and Oracle technology, to bring the focus back on the business while in the meantime allowing the customer enjoy the new technologies with next-to-no hassle and without incurring major investments. In addition to being a real family man, a photographer and die-hard film buff, Rokesh is also a fitness instructor. â€¢ Qualogy Board Member and Head of Qualogy Product Development â€¢ Organizer Google Developer Group Netherlands ','369');
